import './../../Css/Announcement/Arraylist.css'
import axios from 'axios';


useEffect(() => {
    axios('https://60aa459d66f1d000177729b4.mockapi.io/api/v1/announcement')
      .then(response => {
        console.log(response.data)
        setAllData(response.data);
        setFilteredData(response.data);
      })
      .catch(error => {
        console.log('Error getting fake data: ' + error);
      })
  }, []);

class Arraylist extends React.Component {

    newstype={
        myarray:["Important News", "General News"]
    }



    render()
    {
        return(
            <div>
                <select>
                    {this.newstype.myarray.map(data=>(
                        <option title={data}>{data}</option>
                    ))}
                </select>


            </div>
        );
    }
}
export default Arraylist;
